  [],\n\t\"revision_timestamp\": \"2015-05-07T03:55:12.207126\",\n\t\"name\": \"passive-wireless-saw-humidity-sensors-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This proposal describes the preliminary
  development of passive wireless surface acoustic wave (SAW) based humidity sensors
  for NASA application to distributed humidity monitoring systems.  SAW devices are
  a platform technology for passive wireless sensing of numerous possible measurands.
  \ SAW devices have been demonstrated as passive wireless temperature sensors in
  NASA contracts NNK04OA28C and NNK05OB31C, and as hydrogen sensors and cryogenic
  liquid level sensors under contracts NNK06OM24C and NNK06OM23C.  ASR&amp;D is currently
  developing these sensors and systems further under NASA Phase II STTR contracts
  NNK07EA38C and NNK07EA39C.  The proposed humidity sensors will use individually
  coded SAW device structures combined with hygroscopic film elements to produce rapid,
  sensitive humidity sensors capable of wireless operation over the full range of
  relative humidity (0&#37; to 100&#37;).  The Phase I research will utilize the results
  obtained in ASR&amp;D's coded SAW sensor and wireless interrogation system research,
  and external research on SAW-based and nanofilm based humidity sensing techniques.
  \ The team will evaluate hygroscopic films previously investigated and novel nanostructured
  films, along with sensor device simulation, to determine which films are most likely
  to produce devices with desirable characteristics.  Issues including formation of
  chemically selective films on piezoelectric substrates, optimization of this film,
  and the effects of environmental factors on device performance will be investigated.
  \ Successful completion of the proposed Phase I activities will establish the technical
  feasibility of producing the proposed humidity sensors, evaluate their potential
  performance capabilities in a range of operational environments, and define the
  additional work necessary to effect device implementation.  Assuming the results
  of Phase I are positive, Phase II could result in the development of multiple uniquely
  identifiable, wirelessly interrogable, humidity sensors.\",\n\t\"license_title\":
